from collections import deque


class Solution:
    def numIslands(self, grid) -> int:
        if len(grid) == 0:
            return 0
        expanded = set()
        expanding = deque()
        cal = 1

        def checkfaild(x, y):
            if x < 0 or y < 0 or x >= len(grid) or y >= len(grid[0]):
                return True
            if grid[x][y] > '0':
                return False
            return True

        for i in range(len(grid)):
            for j in range(len(grid[0])):
                if (i,j) in expanded:
                    continue
                if grid[i][j] > '0':
                    expanding.append([i, j])
                    while (len(expanding) > 0):
                        x, y = expanding.popleft()
                        expanded.add((x,y))
                        grid[x][y] = str(cal)
                        for m, n in [[0, 1], [1, 0], [-1, 0], [0, -1]]:
                            newx = x + m
                            newy = y + n
                            if checkfaild(newx, newy):
                                continue
                            if (newx, newy) in expanded:
                                continue
                            if [newx, newy] in expanding:
                                continue
                            expanding.append([newx, newy])
                    cal += 1
        return cal - 1


